{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/bryannacantu/bellabeat-s-case-study?scriptVersionId=105155195\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"5430cdcc","metadata":{"papermill":{"duration":0.008939,"end_time":"2022-09-07T19:04:28.987032","exception":false,"start_time":"2022-09-07T19:04:28.978093","status":"completed"},"tags":[]},"source":["---\n","title: \"Case Study for Bellabeat\"\n","author: \"Bryanna Cantu\"\n","date: \"2022-08-15\"\n","output:\n","  pdf_document: default\n","  html_document: default\n","  word_document: default\n","---\n","\n","## About Bellabeat\n","\n","*Bellabeat is a successful high-tech manufacture of health-focused products for women. The products collect data related to their activity, sleep, stress, menstrual cycle, and mindful habits. The data gathered helps women understand their current habits and make healthy decisions. Seeking new growth opportunities, Urška Sršen, co founder and creative Officer of Bellabeat, believes analyzing the smart device fitness data can help.*\n","\n","## Goal for this Project\n","\n","Identify trends in tracker usage and recommend market strategies for Bellabeat products. In other words, How do our users use our products? \n","\n","## About the Dataset\n","\n","Within the dataset, we're given a single directory full of .csv files that contain daily, hourly, and every-minute data on participants. \n","\n","## Questions For Analysis\n","1. *What are some trends in smart device usage?*\n","2. *How could these trends apply to Bellabeat customers?*\n","3. *How could these trends help influence Bellabeat marketing strategy?*\n","\n","\n","## Preparing Data\n","\n","\n","The data source used for our case study is FitBit Fitness Tracker Data. This dataset is stored in Kaggle and was made available through Mobius.https://www.kaggle.com/datasets/arashnic/fitbit\n","\n","\n","I started off by first importing and loading the needed packages for cleaning functions to help clean the datasets. I then assign dataframe names to the **.csv** files. \n","\n"]},{"cell_type":"markdown","id":"6e443e24","metadata":{"papermill":{"duration":0.005326,"end_time":"2022-09-07T19:04:28.997757","exception":false,"start_time":"2022-09-07T19:04:28.992431","status":"completed"},"tags":[]},"source":["# R loading packages\n"]},{"cell_type":"code","execution_count":1,"id":"ac281e75","metadata":{"execution":{"iopub.execute_input":"2022-09-07T19:04:29.013396Z","iopub.status.busy":"2022-09-07T19:04:29.010989Z","iopub.status.idle":"2022-09-07T19:04:30.645218Z","shell.execute_reply":"2022-09-07T19:04:30.643151Z"},"papermill":{"duration":1.644771,"end_time":"2022-09-07T19:04:30.648078","exception":false,"start_time":"2022-09-07T19:04:29.003307","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["── \u001b[1mAttaching packages\u001b[22m ─────────────────────────────────────── tidyverse 1.3.1 ──\n","\n","\u001b[32m✔\u001b[39m \u001b[34mggplot2\u001b[39m 3.3.6     \u001b[32m✔\u001b[39m \u001b[34mpurrr  \u001b[39m 0.3.4\n","\u001b[32m✔\u001b[39m \u001b[34mtibble \u001b[39m 3.1.7     \u001b[32m✔\u001b[39m \u001b[34mdplyr  \u001b[39m 1.0.9\n","\u001b[32m✔\u001b[39m \u001b[34mtidyr  \u001b[39m 1.2.0     \u001b[32m✔\u001b[39m \u001b[34mstringr\u001b[39m 1.4.0\n","\u001b[32m✔\u001b[39m \u001b[34mreadr  \u001b[39m 2.1.2     \u001b[32m✔\u001b[39m \u001b[34mforcats\u001b[39m 0.5.1\n","\n","── \u001b[1mConflicts\u001b[22m ────────────────────────────────────────── tidyverse_conflicts() ──\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mfilter()\u001b[39m masks \u001b[34mstats\u001b[39m::filter()\n","\u001b[31m✖\u001b[39m \u001b[34mdplyr\u001b[39m::\u001b[32mlag()\u001b[39m    masks \u001b[34mstats\u001b[39m::lag()\n","\n","\n","Attaching package