 App Recommendations \n","\n","* Reminders to inform the user to get adequate sleep\n","* Reminders to inform users to stretch, meditate, get up and walk, stretch in bed, etc. depending on the users movement \n","* Provide healthy meal ideas on BellaBeat app to encourage weight loose \n","\n","\n"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":9.503697,"end_time":"2022-09-07T19:04:34.691107","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-09-07T19:04:25.18741","version":"2.3.4"}},"nbformat":4,"nbformat_minor":5}